insert into SYS_PARAMS (PARAMGROUP_ID, PARAM_ID, PARAM_VAL, PARAM_NAME, MEMO, ST, IS_LOCK, IS_DEL, CRT_DT, LAST_UPD_TMS, LAST_UPD_OPER) values ('MSGINFO', '01', '【汇丰银行】尊敬的客户，你好！根据监管要求及我行《信用卡领用合约》的规定，我行温馨提醒，个人信用卡透支款项应当用于个人日常消费领域，远离POS机及网络套现等违法行为。如果违反规定，我行将有权根据监管要求及《信用卡领用合约》的规定对信用卡采取调降信用额度、止付账户等相应风险管理措施。特此提醒信用卡透支款项用于真是的消费用途，以确保信用卡正常使用。如有疑问请咨询4008695366/+862120534444（海外）客户服务热线。此条短信仅为提醒，如果您未有违规类交易敬请忽略。谢谢您的配合！', null, null, null, null, null, null, null, null);
insert into SYS_PARAMS (PARAMGROUP_ID, PARAM_ID, PARAM_VAL, PARAM_NAME, MEMO, ST, IS_LOCK, IS_DEL, CRT_DT, LAST_UPD_TMS, LAST_UPD_OPER) values ('MSGINFO', '02', '【汇丰银行】尊敬的客户，根据监管要求及我行《信用卡领用合约》的规定，个人信用卡透支款项应用于消费领域，不得用于房产类、投资和生产经营等非消费领域。请您务必注意，不要将信用卡透支款项用于以上用途，如违反规定我行将有权对您的信用卡采取限制措施。如果您有交易涉及上述非消费领域，请拨打4008695366/+862120534444（海外）确认您的交易。谢谢您的配合。', null, null, null, null, null, null, null, null);
insert into SYS_PARAMS (PARAMGROUP_ID, PARAM_ID, PARAM_VAL, PARAM_NAME, MEMO, ST, IS_LOCK, IS_DEL, CRT_DT, LAST_UPD_TMS, LAST_UPD_OPER) values ('MSGINFO', '03', '【汇丰银行】尊敬的客户，你好！由于系统监测到您的汇丰信用卡交易存在异常，谨此提醒规范用卡。请您于5个工作日内提供相关交易的证明材料，交易详情为：”YYYY/MM/DD消费人民币@AMT@元与@MERCHANTID@商户”的凭证至指定邮箱CCRECEIPT@hscb.com.cn，以便我行进一步核实。如有疑问请咨询4008695366/+862120534444（海外）客户服务热线。', null, null, null, null, null, null, null, null);
insert into SYS_PARAMS (PARAMGROUP_ID, PARAM_ID, PARAM_VAL, PARAM_NAME, MEMO, ST, IS_LOCK, IS_DEL, CRT_DT, LAST_UPD_TMS, LAST_UPD_OPER) values ('MSGINFO', '04', '【汇丰银行】尊敬的客户，你好！由于您未在我行规定时间内提供您的交易相关证明材料，请在收到本短信后的5个工作日内补充交易详情为：”YYYY/MM/DD消费人民币@AMT@元与@MERCHANTID@商户”的凭证至指定邮箱CCRECEIPT@hscb.com.cn。如届时仍未提供或凭证未验证通过，根据我行信用卡相关条款，您的信用卡将被限制使用，敬请知悉！如有问题请致电4008695366/+862120534444（海外）客户服务热线。', null, null, null, null, null, null, null, null);
insert into SYS_PARAMS (PARAMGROUP_ID, PARAM_ID, PARAM_VAL, PARAM_NAME, MEMO, ST, IS_LOCK, IS_DEL, CRT_DT, LAST_UPD_TMS, LAST_UPD_OPER) values ('MSGINFO', '05', '【汇丰银行】尊敬的客户，你好！由于您提供的交易凭证等相关证明材料没有验证通过，请在收到短信后的5个工作日内补充交易详情为：”YYYY/MM/DD消费人民币@AMT@元与@MERCHANTID@商户”的凭证至指定邮箱CCRECEIPT@hscb.com.cn。如届时未提供相关凭证或仍未通过验证，根据我行信用卡相关条款，您的信用卡将被限制使用，敬请知悉！如有问题请致电4008695366/+862120534444（海外）客户服务热线。', null, null, null, null, null, null, null, null);
insert into SYS_PARAMS (PARAMGROUP_ID, PARAM_ID, PARAM_VAL, PARAM_NAME, MEMO, ST, IS_LOCK, IS_DEL, CRT_DT, LAST_UPD_TMS, LAST_UPD_OPER) values ('MSGINFO', '06', '【汇丰银行】尊敬的客户，你好！根据我行对您的最新评估，您的交易凭证已通过审核。特此提醒您仅将信用卡透支款项用于真实的消费用途，以确保您的信用卡正常使用。祝您用卡愉快。', null, null, null, null, null, null, null, null);
